import React from 'react'
// import React, { useState } from 'react'

const  ChildDataEmployee =(props)=>{
    const [data, setData] = useState([
        { firstName: 'pasya', lastName: 'Sholeh', pekerjaan: 'Web Developer', status: 'Married' },
        { firstName: 'john', lastName: 'doe', pekerjaan: 'Web Developer', status: 'Married' },
        { firstName: 'jane', lastName: 'doe', pekerjaan: 'Designer', status: 'Single' }
      ]);
    return(
        <div class="card">
            <div class="card-body">
              <h5 class="card-title">Data Employee</h5>
              <table class="table table-hover">
                <thead>
                  <tr>
                    <th scope="col">#</th>
                    <th scope="col">firstName</th>
                    <th scope="col">lastname</th>
                    <th scope="col">pekerjaan</th>
                    <th scope="col">status</th>
                  </tr>
                </thead>
                
                <tbody>
                {
                    
                   data.map((item,index) => {
                    return (
                        <tr key={index}>
                          <th scope="row">{item.number}</th>
                          <td>{item.firstName} </td>
                          <td>{item.lastName}</td>
                          <td>{item.pekerjaan}</td>
                          <td>{item.status}</td>
                        </tr>
                              
                             )  
                    })
                }
                </tbody>
              </table>

            </div>
          </div>
    )
}
export default ChildDataEmployee
